import { Component } from 'react';

import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          name: 'Luna',
          id: '12e1231e'
        },
        {
          name: 'Saba',
          id: '12e1131e'
        },
        {
          name: 'Anna',
          id: '11e1231e'
        },
        {
          name: 'Andrei',
          id: '12e1231c'
        }
      ]
    }
  }
  render() {
    return <div className="App">
    {
      this.state.monsters.map((monster) => {
        return <div key={monster.id}><h1></h1>{monster.name}</div>
      })
    }
    </div>;
  }
}

export default App;
